'use strict';
class OpenPositionCalculatedMarginFields {
    usedMargin;
    usedMarginAware;
    tradeId;
    constructor() {
        this.usedMargin = 0.0;
        this.usedMarginAware = 0.0;
        this.tradeId = "";
    }
    getTradeId() {
        return this.tradeId;
    }
    getUsedMargin() {
        return this.usedMargin;
    }
    getUsedMarginAware() {
        return this.usedMarginAware;
    }
    static create(tradeId, usedMargin, usedMarginAware) {
        let openPositionMarginData;
        openPositionMarginData = new OpenPositionCalculatedMarginFields();
        openPositionMarginData.usedMargin = usedMargin;
        openPositionMarginData.usedMarginAware = usedMarginAware;
        openPositionMarginData.tradeId = tradeId;
        return openPositionMarginData;
    }
}
module.exports = OpenPositionCalculatedMarginFields
